import { BrowserRouter, Route, Routes } from 'react-router-dom'
import NevbarComponent from './Components/NevbarComponent.js'
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route element={<NevbarComponent />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
